import BackendTheme from '../components/backend-theme.js';
import  styles from '../components/backend-theme.module.css';

export default function Portal () {
    return(
        <div>
            <BackendTheme pageName={"Portal"} Content={Content}/>
        </div>
    );
}

function Content () {
    return(
        <div className={styles.contentContainer}>
            <div className={styles.card}>
                <h3>Dicord.gg</h3>
            </div>
            <div className={styles.card}>
                <h3>Plex.TV</h3>
            </div>
            <div className={styles.card}>
                <h3>Spitzer Blog</h3>
            </div>
            <div className={styles.card}>
                <h3>DISCORD</h3>
            </div>
        </div>
    );
}
